    [],nt"revision_timestamp": "2013-03-14T21:52:24.218633",nt"name": "north-cascades-national-park-service-complex-natural-resource-preservation-program-amphibian-inac261",nt"isopen":
    false,nt"url": null,nt"notes": "The 1997 amphibian inventory in North Cascades
    National Park Service Complex Bridge Creek watershed was funded as the part of a
    four year program to inventory amphibians in Pacific northwest National Parks. In
    1996, the first year of this program, National Park Service staff conducted an amphibian
    inventory of the Big Beaver watershed. This report presents methods and data collected
    during the 1997 field season in Bridge Creek watershed, and an update on frogs of
    Big Beaver valley. Physical, chemical, and amphibian abundance and distribution
    data were collected at twenty-eight stream reaches, seven individual seeps, and
    fifteen lake/ponds . The only amphibian captured in streams was the tailed frog
    Ascaphus truei. One amphibian, Ambystoma macrodactylum, was found at a seep location.
    Five species of amphibians were found in the lake/ponds surveyed. They were: Ambystoma
    macrodactylum, Bufo boreas, Hyla regilla, Rana cascadae, and Rana luteiventris.",nt"license_title":
